        <li>Corruption Perception Index, from the <a href="https://www.transparency.org/en/cpi/2024" target="_blank">Transparency International</a>, last updated on 2024 - Corruption Perception Index (CPI) [2024] by Transparency International is licensed under CC-BYND 4.0. View here: https://www.transparency.org/en/cpi/2024.</li>
